    const name = '천사멘탈소유자';
    const onClick = async () => {
        const zz = await axios.get(`https://kr.api.riotgames.com/lol/summoner/v4/summoners/by-name/${name}?api_key=${'RGAPI-7dadcad5-17b6-478a-8a51-83098abd82d6'}`);
        console.log(zz);
    }
    return (
        <div>
            <button onClick={onClick}>클릭</button>
        </div>
    );
};

export default Home;
